import React,{useEffect,useRef,useState} from 'react'
import { Tabs } from 'antd'
import "./index.scss"

export default function Navigator() {

  const onChange = (key) => {
    console.log(key);
  };

  const items = useRef([
    {
      key: '1',
      label: `Tab 1`,
    },
    {
      key: '2',
      label: `Tab 2`,
    },
  ]);

  return (
    <div id="navigator_container">
        <Tabs defaultActiveKey="1" items={items.current} onChange={onChange} />
    </div>
  )
}
